class FABS:
    def __init__(self, agency, submission_data):
        self.agency = agency
        self.submission_data = submission_data
        self.validation_rules = {
            "loan_records": ["zero", "blank"],
            "non_loan_records": ["zero", "blank"]
        }
        self.derived_data_elements = []

    def validate_submission(self):
        errors = []
        for record in self.submission_data:
            if record["record_type"] == "loan" and record["value"] not in self.validation_rules["loan_records"]:
                errors.append("Invalid value for loan record")
            elif record["record_type"] == "non_loan" and record["value"] not in self.validation_rules["non_loan_records"]:
                errors.append("Invalid value for non-loan record")
        return errors

    def derive_data_elements(self):
        self.derived_data_elements = []
        for record in self.submission_data:
            if record["record_type"] == "loan":
                self.derived_data_elements.append({"record_type": "loan", "value": record["value"] * 2})
            elif record["record_type"] == "non_loan":
                self.derived_data_elements.append({"record_type": "non_loan", "value": record["value"] * 3})

    def get_derived_data_elements(self):
        return self.derived_data_elements


class Broker:
    def __init__(self, fabs_data):
        self.fabs_data = fabs_data

    def validate_fabs_data(self):
        errors = []
        for record in self.fabs_data:
            if not record["record_type"]:
                errors.append("Missing record type")
            elif not record["value"]:
                errors.append("Missing value")
        return errors

    def upload_and_validate(self):
        errors = self.validate_fabs_data()
        if errors:
            return errors
        else:
            return "Data uploaded and validated successfully"


class Developer:
    def __init__(self, fabs_submissions):
        self.fabs_submissions = fabs_submissions

    def add_updates_to_fabs_submission(self, submission_id):
        for submission in self.fabs_submissions:
            if submission["id"] == submission_id:
                submission["status"] = "updated"
                return submission
        return None

    def add_gtas_window_data(self):
        gtas_window_data = []
        for submission in self.fabs_submissions:
            gtas_window_data.append({"submission_id": submission["id"], "gtas_window": "open"})
        return gtas_window_data


